(browsersData=>{if("outdated"in browsersData&&browsersData.outdated){const css=document.createElement("link");css.rel="stylesheet";css.href="BROWSERS_URI"+"browsers.min.css";document.body.appendChild(css);const elem=jQuery(`<section id="browser-alert"><h1>Please Update Your Browser</h1><p><strong>You are using an outdated browser, ${browsersData.browser_name} version ${browsersData.user_version}.</strong></p><p>Outdated browsers can make your computer unsafe and may not properly work with this website.&nbsp;To ensure security, performance, and full functionality, please upgrade to an up-to-date browser.</p><ul></ul></section>`);Object.keys(browsersData.info).forEach(browserCode=>{const browser=browsersData.info[browserCode];const li=jQuery(`<li><a href="${browser.url}" title="${browser.long_name}" target="_blank"><div class="icon"><img src="${"BROWSERS_URI"}../../images/browsers/${browserCode}.svg"></div><h2>${browser.name}</h2></a><p class="info"><em>${browser.info}</em></p><p class="version">Latest Version: <strong>${browser.version}</strong></p><p class="website"><a href="${browser.url}" title="${browser.long_name}" target="_blank">Visit Official Website</a></p></li>`);elem.find("ul").append(li)});jQuery("body").append(elem)}})(BROWSERS_DATA);
